import Vue from 'vue'
import Router from 'vue-router'
import ViewAbout from '../components/ViewAbout.vue'

Vue.use(Router)

export default new Router({
  // デフォルトの挙動では URL に `#` が含まれる.
  // URL から hash を取り除くには `mode:history` を指定する
  mode: 'history',
  base: process.env.BASE_URL,
  routes: [
    {
      path: '/',
      name: 'ViewAbout',
      component: ViewAbout
    },
  ]
})
